    <form>
      <label>ID:</label>
      <input type="number" onChange={idChangeHandler}></input>
      <label>Product:</label>
      <input type="text" onChange={productChangeHandler}></input>
      <label>Price:</label>
      <input type="number" onChange={priceChangeHandler}></input>
      <button type="submit">Add Product</button>
    </form>
  );
};
export default Form;
